function filename(contentType, filename) {

    if (!contentType) {
        if (filename) return filename;
        return;
    }

    if (filename) {
        let str = '';
        try {
            let legit = iml.mime(filename);

            if (legit) {
                str = filename;
            }
            else {
                throw new Error;
            } 
        }
        catch (e) {
            switch (contentType) {
