function downloadUrl(body, parameter) {

    if (body.mimeType.startsWith('image')) {
        if (parameter.customize) {
            return body.baseUrl + '=w' + parameter.width + '-h' + parameter.height;
        }
        else if (body.mediaMetadata)
        {
            return body.baseUrl + '=w' + body.mediaMetadata.width + '-h' + body.mediaMetadata.height;
        }
        else {
            return body.baseUrl + '=d';
        }

    }
    else {
        return body.baseUrl + '=dv';
    }

}

